export default function Principale() {
  // const ref=useRef();
  // useEffect(()=>{
  //   ref.current.classList.add("principale2");
  // },[])

  return (
    <div  className='principale'>
          <div id='containerphoto'>
            <img src={photoprofil}>
            </img>
          </div>
    </div>
  )
}
